Von Aaron stammte Nadab, Abiu, Eleazar, und Ithamar ab;
von diesen starben Nadab und Abiu, als sie fremdes Feuer vor den Herrn brachten.
Alle also, welche gezählt wurden, waren zusammen dreiundzwanzigtausend männlichen Geschlechtes von einem Monate an und darüber; denn sie wurden nicht unter den Söhnen Israels gezählt und es ward ihnen kein Erbbesitz mit den übrigen gegeben.
